import React from 'react';
import logo from './logo.svg';
import './App.css';
// Header Component 
import styled from 'styled-components';
import Header from './components/Header';

const HeroWrapper = styled.div`
  max-width: 680px;
  text-align: left;
`

const Headline = styled.h1`
  font-size: 78px;
  margin: 15px 0 10px 0;
  padding: 0;
  line-height: 1;
  text-align: left;
  @media screen and (min-width: 48em) {
    font-weight: 400;
    letter-spacing: -0.6px;
  }
`
const SubHeadline = styled.h1`
  font-size: 40px;
  line-height: 1;
  font-weight: 400;
`

function App() {
  return (
    <div className="App">
      <Header /> 
      <HeroWrapper>
        <Headline>Google Developer Group El Paso</Headline>
        <SubHeadline>We are a group of students and industry professionals who share a love for coding and developing & we strive to share that passion with others!</SubHeadline>
      </HeroWrapper>
    </div>
  );
}

export default App;
